import React from "react";
import GoogleApiWrapper from "../APIs/mapsAPI";
import WeatherCard from "./WeatherCard";

const LocationData = props => {
  return (
    <div>
      <GoogleApiWrapper
        lat={props.lat}
        lon={props.lon}
      />
      <WeatherCard
        weatherForecast={this.state.weatherForecast}
      />
    </div>
  );
};

export default LocationData;
